import React from 'react';
import Card from './Card';
import {robots} from './robots';

const CardList = ({robots}) => {

    const cardArray = robots.map((robot, i) => {
        return (
            <Card 
                key={i}f
                id={robot[i].id} 
                name={robot[i].name} 
                email={robot[i].email}  />
        )
    });

    return (
        {cardArray}
    );
}

export default CardList;
